class ProjectStatisticalRequestModel {  int? manageProjectId;  String? statisticalType;  int? statusId;  ProjectStatisticalRequestModel(      {this.manageProjectId, this.statisticalType, this.statusId});  ProjectStatisticalRequestModel.fromJson(Map<String, dynamic> json) {    manageProjectId = json['manage_project_id'];    statisticalType = json['statistical_type'];    statusId = json['status_id'];  }  Map<String, dynamic> toJson() {    final Map<String, dynamic> data = new Map<String, dynamic>();    data['manage_project_id'] = this.manageProjectId;    data['statistical_type'] = this.statisticalType;    data['status_id'] = this.statusId;    return data;  }}